        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <>
            <div className="navbar">
            <Nav>Menu</Nav>
            <Nav>About</Nav>
            <Nav>Contact</Nav>
            </div>
            </>
        );
    }
}

export default Menu;
